def binarySearch(ds, l, r, x):
    if (r>=l):
        mid = int(l + (r - l) / 2)
        if (ds[mid]['a'] == x):
            return mid

        if (ds[mid]['a'] > x):
            return binarySearch(ds, l, mid - 1, x)

        return binarySearch(ds, mid + 1, r, x)
        
    return -1


def readJSON():
    with open (filename, 'r') as f:
        data = json.load(f)
    f.close()
    return data


def writeJSON(data):
    with open (filename, 'w') as f:
        json.dump(data, f)
        # json.dump(data, f, indent=4)
    f.close()


def deletion(word):
    # Local Variable
    global ds
    global arr
    global insertFunctionList
    global deleteFunctionList
    isPresent = True
    strlen = len(word)
    ds = readJSON()

    # Binary Search
    for i in range(0, strlen):
        if (i==0):
            index = binarySearch(ds, 0, len(ds)-1, word[i])
            if (index==(-1)):
                isPresent = False
                break
            else:
                var = ds[index]

        else:
            index = binarySearch(var, 0, len(var)-1, word[i])
            if (index==(-1)):
                isPresent = False
                break
            else:
                var = var[index]

        arr.append(index)
        if (var['c']==None):
            if (i!=(strlen-1)):
                isPresent = False
            break

        if (i!=strlen-1):
            var = var['c']

    if (isPresent==False):
        return None

    elif (isPresent==True and var['b']==None):
        return None

    else:
        # Checking parent and child nodes before deleting element
        if (var['c']!=None and var['b']!=None):
            arrLen = len(arr)
            var['b'] = None
            tempVar = []
            tempVar.append(var)

            insertFunctionList[arrLen-1](tempVar)
            writeJSON(ds)

            # updateJSON(tempVar, arrLen-1)
            del (tempVar)
            return True

        elif (var['c']==None and var['b']!=None):
            arrLen = len(arr)
            for i in range(strlen-1, 0, -1):
                # updateJSON(None, i)
                deleteFunctionList[i]
                writeJSON(ds)

            return True

        else:
            return False


def insertion(word, str_content = '*'):
    # Local Variable
    global ds
